tables.table_schema:
CREATE TABLE bioenergy_research_data (
    experiment_id INT PRIMARY KEY,
    biofuel_type VARCHAR(50),
    conversion_technique VARCHAR(50),
    efficiency FLOAT
);

CREATE TABLE Biofuel_Conversion_Research (
  research_id INT PRIMARY KEY,
  research_title TEXT,
  researcher_name TEXT,
  research_date DATE
);

CREATE TABLE biofuel_experiments (
  experiment_id INT PRIMARY KEY,
  experiment_date DATE,
  biofuel_type VARCHAR(50),
  conversion_efficiency DECIMAL
);

CREATE TABLE experimental_conditions (
  condition_id INT PRIMARY KEY,
  temperature DECIMAL,
  pressure DECIMAL,
  catalyst VARCHAR(50)
);

CREATE TABLE research_team (
  team_id INT PRIMARY KEY,
  researcher_name VARCHAR(100),
  institution VARCHAR(100),
  email VARCHAR(100)
);

CREATE TABLE experiment_data (
    id INT PRIMARY KEY,
    experiment_date DATE,
    biofuel_type VARCHAR(50),
    conversion_efficiency DECIMAL
);

CREATE TABLE research_team (
    researcher_id INT PRIMARY KEY,
    researcher_name VARCHAR(100),
    research_area VARCHAR(100)
);

CREATE TABLE experimental_setup (
    setup_id INT PRIMARY KEY,
    setup_description TEXT,
    equipment_used VARCHAR(100)
);

CREATE TABLE results_analysis (
    analysis_id INT PRIMARY KEY,
    experiment_id INT,
    analysis_date DATE,
    analysis_result TEXT
);
